fn bubble_sort_array(tab: &mut [i32]) {
    let n = tab.len();
    for i in 0 .. n-1 {
        for j in i + 1 .. n {
            if tab[i] > tab[j] {
                let aux = tab[j];
                tab[j] = tab[i];
                tab[i] = aux;
            }
        }
    }
}

